import React, { useContext, createContext } from "react";
import ReactDOM from "react-dom";

import App from "./App";

export const TitleContext = createContext();

const rootElement = document.getElementById("root");
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  rootElement
);
